tables.table_schema:
CREATE TABLE VehicleEmissions (
    vehicle_id INT,
    vehicle_type VARCHAR(255),
    emission_level FLOAT
);

CREATE TABLE TransportationData (
    trip_id INT,
    vehicle_id INT,
    trip_distance FLOAT,
    trip_duration TIME
);

CREATE TABLE Vehicle (
    id INT PRIMARY KEY,
    brand VARCHAR,
    model VARCHAR,
    year INT
);

CREATE TABLE Emissions (
    id INT PRIMARY KEY,
    vehicle_id INT,
    emission_level FLOAT,
    timestamp TIMESTAMP
);

CREATE TABLE EnvironmentImpact (
    id INT PRIMARY KEY,
    location VARCHAR,
    emission_level_threshold FLOAT,
    impact_type VARCHAR
);

CREATE TABLE manufacturer (
    id INT PRIMARY KEY,
    name VARCHAR(100),
    country VARCHAR(50),
    headquarters VARCHAR(100)
);

CREATE TABLE emissions_standards (
    id INT PRIMARY KEY,
    standard_name VARCHAR(100),
    description TEXT
);
